Такое разнообразие состава обеспечивает мышцы спортсмена максимально полным спектром заменимых и незаменимых аминокислот, а так же дает равномерное поступление их в кровь в течение длительного периода времени.
Super Formula изготовлен только из высококачественных компонентов, по современным технологиям. В настоящее время продукт доступен в трех упаковках:  34 грамма (разовая упаковка, которая позволит Вам ознакомиться с новым протеином), 476 грамм и 3128 грамм.  Вкусовые варианты представлены трех видов: банановый, трюфель и малиновый.
С подробным описанием протеина можно ознакомиться на странице товара.
